import "../style/App.scss";
import CatList from "./Catlist";

function App() {
  return (
    <div className='App'>
      <section className='section-cats'>
        <h1>All Cats Are Beautiful</h1>
        <CatList />
      </section>
    </div>
  );
}

export default App;
